import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'; 
const one=()=>{
  return <div> page one 
    <Link to ="/pagetwo">navigate to two</Link>
  </div>;
}
const two=()=> {
  return <div> 
    page two 
    <button>
      click me
    </button>
    <Link to="/">navigate to one</Link>
    </div>;
}
const App=()=> {
  return (
    <div>
      <BrowserRouter>
      <div>
        <Route path="/" exact component={one} />
        <Route path="/pagetwo" component={two} />
      </div>
      </BrowserRouter>
    </div>
  )
}
export default App
